import React from 'react';

const List = props => {
    const users = props.users.map(user => (
    <div key={user.artist}>
    
        <h4>{`${user.name.title}${user.name.last}`}</h4>
        <p>{user.email}</p>
        </div>
            ))
    return ( 
    
        <ul>{users}</ul>
         );
}
 
export default List;
